export default function Navbar({ role, logout }) {
  return (
    <nav className="bg-white px-6 py-4 shadow flex justify-between">
      <h1 className="text-xl font-bold text-red-500">FoodDash</h1>
      <div>
        <span className="px-3 py-1 bg-red-100 rounded mr-4">{role}</span>
        <button onClick={logout}>Logout</button>
      </div>
    </nav>
  );
}
